'use strict';

/**Get img in Base64 format*/
var imgURL = "https://www.hotcouponworld.com/wp-content/uploads/2014/12/winterboots.jpg";
var request = require('request').defaults({ encoding: null });
function getBase64(urlImg){
    request.get(urlImg, function (error, response, body) {
        if (!error && response.statusCode == 200) {
            // data = "data:" + response.headers["content-type"] + ";base64," + new Buffer(body).toString('base64');
            // console.log(data);
            var data = new Buffer(body).toString('base64');
            console.log("Converting img to b64: "+ data);
            return  data;
        }
    });
}

var b64 = ""

/**Socket*/
socket.on('connect', function(){
    var b64fromUrl = getBase64(imgURL);
    console.log("Sending image in Base64: "+b64fromUrl.toString());
    socket.emit("EVENT_MESSAGE",b64fromUrl.toString()); //getBase64(imgURL);
});
